        assert(isAsset[addr]);
        Asset memory asset = assets[addr];
        s = asset.assetName;
        t = asset.assetType;
        b = asset.assetBalance;
        add = asset.assetAddr;         
    }

    function getAssetAddresses() external payable returns(address[] memory ){
        address[] memory a = new address[](allAssets.length);

        for(uint i = 0; i < allAssets.length; i++){
            a[i] = allAssets[i];
        }

        return a;
    
    }

